import React from 'react';
import s from './Item.module.css'
import {NavLink} from 'react-router-dom';
const Item = (props) => {

    return (
      <div className={s.wrapper}>
        <img className={s.logo} src={this.props.operators[0].source} alt="" />
        <NavLink className={s.operator} to={props.source}>
          {props.operators[0].name}
        </NavLink>
      </div>
    );
        }
export default Item;
